import React from "react";
import './aboutme.css';
import selfieMinha from './insta.PNG';

function About (){

    return(
        <div className="me">
          <div className="fotominha" > <img id="ft"src={selfieMinha} /> </div>
          <div className="resumo" > <spam>Olá, me chamo Carlos Henrique Pizzi, nasci em uma cidade no interior de São Paulo, atualmente tenho 22 anos. Desde 9 anos de idade 
            eu já utilizava o computador, pois, adorava jogar no Clickjogos, aos 12 anos já jogava online, um jogo no qual meu primo tinha me apresentado e apartir disso
            eu fui criando cada vez mais vontade de aprender sobre computadores, aprendi sobre placa de videos, processadores, peças no geral, aprendi como fazer uma formatação
            como fazer manutenção, montagem, desmontagem, etc... Fui militar durante 4 anos, servi na Academia da Força Aérea (AFA)
            lá trabalhei durante 3 anos   </spam> </div>

        </div>
    )
}

export default About
